import React, {useState, Component, useEffect} from 'react'
import axios from 'axios'
import Contact from './Contact'
import '../../styles/Page.css'


const Dashboard = ({api, stage, setStage, contacts, setContacts, isLoggedIn}) => {
    const [storedData, setStoredData] = useState('')

    useEffect(() => {
        console.log(isLoggedIn);
        if(isLoggedIn) {
            const apiToken = window.localStorage.getItem('api_token') 

            api.get(`/contacts`, {headers: {token: apiToken}}).then(res => {
                const resData = res.data
                if(resData !== storedData) {
                    setStoredData(resData)
                }
  
     
                return        
                }).catch(error => {
                    console.log(error.response.data.message)

                })
        }
    },[contacts])
    setContacts(storedData)   

    return (
        <div className='container'>
            {/* {contacts.firstName !== '' ? contacts[0].first_name : 'aaa' } */}
        </div>
    )
}

export default Dashboard
